import React, { Component } from "react";

class Tester extends Component {
  constructor(props) {
    super(props);

    this.state = {
      details: []
    };
  }

  componentDidMount() {
    this.setState({ isLoading: true });

    fetch(
      "https://npdpl9r340.execute-api.us-east-1.amazonaws.com/prod/marketdata/v1/summary/â€‹BTC"
    )
      .then(response => response.json())
      .then(data =>
        this.setState({
          details: data
        })
      );
  }

  render() {
    const { details } = this.state;
    return <div>{details.name}</div>;
  }
}

export default Tester;
